// api.js

// ✅ Fetch data from Node.js backend (http://localhost:3000)
export async function getUsers() {
  try {
    const response = await fetch("http://localhost:3000/users");
    return await response.json();
  } catch (error) {
    console.error("Error fetching users:", error);
  }
}

// ✅ Fetch data from Java backend (http://localhost:9090/maven-archetype-webapp/hello)
export async function getMessageFromJava() {
  try {
    const response = await fetch("http://localhost:9090/maven-archetype-webapp/hello");
    return await response.text();
  } catch (error) {
    console.error("Error fetching message:", error);
  }
}
